//O arquivo index.js é o ponto de entrada da aplicação no nível do JavaScript.
//É onde o React é utilizado para renderizar o componente principal (App) na DOM.
//Além disso, o React.StrictMode é envolvido em torno do App para detectar
// possíveis problemas na sua aplicação durante o desenvolvimento.

import React from 'react'; //importa a biblioteca React.
import ReactDOM from 'react-dom/client'; //importa a API ReactDOM.
import './index.css'; 

//Importa o componente principal da aplicação (App.js).
import App from './App';

//Cria na constante "root" a raiz React através da função createRoot.
//O elemento DOM com o ID root (<div>) é obtido com "document.getElementById('root')"
const root = ReactDOM.createRoot(document.getElementById('root'));

//Renderização do Componente Principal (App).
//Utiliza o método render para renderizar o componente App dentro da raiz React.
//O componente App é envolvido por React.StrictMode, que é uma ferramenta para
//destacar potenciais problemas durante o desenvolvimento.
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
